import { memo } from 'react';
import SignInPage from './Pages/SignInPage/component';
import Customers from './Pages/Customers/component';
import Home from './Pages/Home/component';
import Suppliers from './Pages/Suppliers/component';
import Items from "./Pages/Items/component";
import EmployeesData from "./Pages/EmployeesData/component"
import './style.css'
//@ts-ignore
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from "./components/Header/component";
import Footer from "./components/Footer/component";

const App = () => {

  return (
    <div className="App">
      <Router>
        <div className="container">
          <Switch>
            <Route exact path="/" component={SignInPage} />
            <Route path="/customers">
              <Header />
              <Customers />
              <Footer />
            </Route >
            <Route path="/home" >
              <Header />
              <Home />
              <Footer />
            </Route >
            <Route path="/suppliers">
              <Header />
              <Suppliers />
              <Footer />
            </Route >
            <Route path="/items">
              <Header />
              <Items />
              <Footer />
            </Route >
            <Route path="/employeeData">
              <Header />
              <EmployeesData />
              <Footer />
            </Route >
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default memo(App);
